import './styles/global.css';
import Header from "./Components/Header";
import SectionWithTiles from "./Components/SectionWithTiles";
import Description from "./Components/Description";
import Footer from "./Components/Footer";

function App() {
  return (
    <div className="App">
      <Header/>
        <Description/>
        <SectionWithTiles/>
      <Footer/>
    </div>
  );
}

export default App;
